import { useDispatch, useSelector } from 'react-redux';
import { userData } from './action';

export const User = () => {
  const dispatch=useDispatch()
  const {user}= useSelector((state)=>state.user)
  useEffect(()=>{
    dispatch(userData())},[]
  )
  return (
    <div></div>
  )
}
